    const [productList, setProductList] = useState([])
    const options = [{}];

    useEffect(()=> {
        fetch('http://localhost:3001/api/get/')
        .then((resp) => resp.json())
        .then((resp) => setProductList(resp))
        .catch((error) => console.log(error));
      }, []);

      productList.map((e)=>{
        options.push({"id": e.id, "name": e.productName})
      })

      console.log(options)



    return(
        <div className="App">
            <select>
    {Object.keys(options).map(element => <option key={element[id]} value={options[element]}>{element}</option>)}
      </select>
        </div>
    
    );
}
